import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Dashboard.css'; // Yeni CSS dosyasÄ±nÄ± kullanacak
import { socket } from './socket'; // Socket'i import ediyoruz

function Dashboard() {
  const navigate = useNavigate();
  // *** YENÄ°: Gelen mesaj sayÄ±sÄ±nÄ± tutmak iÃ§in state
  const [notificationCount, setNotificationCount] = useState(0);

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  // *** YENÄ°: Sohbet sayÄ±sÄ±nÄ± getiren fonksiyon
  const fetchConversationCount = useCallback(async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/conversations', {
        headers: { 'Authorization': `Bearer ${token}` }
      });
      // Gelen sohbet dizisinin uzunluÄŸunu state'e ata
      setNotificationCount(response.data.length);
    } catch (error) {
      console.error("Sohbet sayÄ±sÄ± alÄ±namadÄ±:", error);
    }
  }, []);

  useEffect(() => {
    // Sayfa ilk yÃ¼klendiÄŸinde sohbet sayÄ±sÄ±nÄ± Ã§ek
    fetchConversationCount();

    // Socket baÄŸlantÄ±sÄ± kur
    socket.connect();
    
    // Yeni bir mesaj geldiÄŸinde veya bir sohbet silindiÄŸinde listeyi yenilemesi iÃ§in dinleyici
    const handleRefresh = () => fetchConversationCount();
    socket.on('admin_refresh_conversations', handleRefresh);

    // Component kaldÄ±rÄ±ldÄ±ÄŸÄ±nda dinleyiciyi ve baÄŸlantÄ±yÄ± temizle
    return () => {
      socket.off('admin_refresh_conversations', handleRefresh);
      socket.disconnect();
    };
  }, [fetchConversationCount]);

  return (
    <div className="dashboard-wrapper">
      <div className="dashboard-container">

        <header className="dashboard-header">
          <span>YÃ¶netici Paneli</span>
          <button onClick={handleLogout} className="logout-button">
            Ã‡Ä±kÄ±ÅŸ Yap
          </button>
        </header>

        <main className="dashboard-content">
          <div className="title-section">
            <h1>ðŸš— BayramlarAuto YÃ¶netim Paneli</h1>
            <p>HoÅŸ geldiniz! Ne yapmak istersiniz?</p>
          </div>
          
          <nav className="navigation-buttons">
            <button onClick={() => navigate('/admin/vehicles')}>AraÃ§ YÃ¶netimi</button>
            <button onClick={() => navigate('/admin/personnel')}>Personel YÃ¶netimi</button>
            <button onClick={() => navigate('/admin/kredi')}>Kredi Hesaplama</button>
            <button onClick={() => navigate('/admin/piyasa')}>Piyasa DeÄŸeri</button>
            <button className="messages-button" onClick={() => navigate('/admin/messages')}>
              Gelen Mesajlar
              {/* *** YENÄ°: Bildirim sayÄ±sÄ± 0'dan bÃ¼yÃ¼kse balonu gÃ¶ster */}
              {notificationCount > 0 && (
                <span className="notification-badge">{notificationCount}</span>
              )}
            </button>
          </nav>
        </main>
        
        {/* Altta hareket eden araba animasyonu */}
        <div className="car-animation-lane">
            <div className="car-silhouette"></div>
             <div className="car"></div>
    <div className="car"></div>
    <div className="car"></div>
    <div className="car"></div>
        </div>

      </div>
    </div>
  );
}

